Prager 20130226  3 Ultimate Issues Hour: God v. the Multi-Verse

Prager H3: Even atheist scientists acknowledge that the universe is so finely tuned that even
 the slightest variation would render life on Earth impossible.
 So how do they explain it?
 Their answer: there are an infinite number of other universes or, as they call it, the multi-verse.
 But do they have any proof? Of course not. 
